import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Register from "./views/Register";
import Header from "./components/header";

const App = () => {
    return (
        <Router>
            <Header />
            <Routes>
                <Route path="/register" element={<Register />} />
            </Routes>
        </Router>
    );
};

export default App;
